import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { logout } from '../store/slices/authSlice';

const Navbar = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const isAuthenticated = useSelector((state) => state.auth.isAuthenticated);

  const handleLogout = () => {
    dispatch(logout());
    navigate('/login');
  };

  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component={Link} to="/" sx={{ flexGrow: 1, textDecoration: 'none', color: 'inherit', display: 'flex', alignItems: 'center' }}>
          <img src="/supermotor-logo.jpg" alt="SuperMotor Logo" style={{ height: 40, marginRight: 10 }} />
          SuperMotor
        </Typography>
        <Box>
          <Button color="inherit" component={Link} to="/buy">Buy</Button>
          <Button color="inherit" component={Link} to="/sell">Sell</Button>
          {!isAuthenticated ? (
            <Button color="inherit" component={Link} to="/login">Login/Signup</Button>
          ) : (
            <>
              <Button color="inherit" component={Link} to="/cars">Cars</Button>
              <Button color="inherit" onClick={handleLogout}>Logout</Button>
            </>
          )}
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
